import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import fetch from 'isomorphic-unfetch'

const Home = ({ posts }) => {
  console.log(posts)
  return (
    <Container fluid>
      <Row>
        {
          posts.map(post => {
            return (
              <Col className="post-listing" sm={6} md={4} lg={3}>
                <img src={post.Hero.Image.url} width="100%" />
                {console.log(post)}
                {post.Title}
              </Col>
            )
          })
        }
      </Row>
    </Container>
  )
}

export async function getServerSideProps()  {
  const { API_URL } = process.env

  const res = await fetch(`${API_URL}/photo-journals`)
  const data = await res.json()

  return {
    props: {
      posts: data
    }
  }
}

export default Home
